import React, { Component } from "react";

class HeroList extends Component {
  render() {
    return (
      <div className="table">
        {this.props.heroList.map(hero => (
          <img src={this.formatText(hero)} height="50" />
        ))}
      </div>
    );
  }
}

export default HeroList;
